import React from 'react';
import { Button } from '@mui/material';

const ReviewBalancesheet = ({balanceSheet, onClickHandler, onBackClick}) => {
  return (
    <div className='balance-sheet-container'>
        <table>
          <thead>
            <tr>
              <th>Year</th>
              <th>Month</th>
              <th>Assets Value</th>
              <th>Profit/Loss</th>
            </tr>
          </thead>
          <tbody>
            {balanceSheet.map(data => (
              <tr>
                <td>{data.year}</td>
                <td>{data.month}</td>
                <td>{data.assetsValue}</td>
                <td>{data.profitOrLoss}</td>
              </tr>
            ))}
          </tbody>
        </table>
        {/* <button onClick={onClickHandler}>Submit Loan</button> */}
        <div style={{ display: 'flex', justifyContent: 'space-between' }}>
              <Button onClick={onBackClick}>Back</Button>
              <Button variant="contained" onClick={onClickHandler}>Submit</Button>
            </div>
    </div>
  );
};
export default ReviewBalancesheet;
